import React, { useState } from "react";
import './Item.css';
import 'animate.css'

function Item(props){
    const [shake,setshake]=useState(false);
    function handleclass(){
        const ele=document.getElementById("portlink");
        ele.addClass('animate__animated animate__shakeX')
    }
    return(
        <div className="title animate__animated animate__zoomIn">
        <a id="portlink" href={props.link} onMouseOver={handleclass}>{props.title}</a>
        </div>
    )
}

export default Item;
